import React, { Fragment } from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import './style.js';

ReactDOM.render(
  <Fragment>
    <App />
    <globalStyle />
  </Fragment>
  ,
  document.getElementById('root')
);
